import React from "react";
import { enGB } from "date-fns/locale";
import { DateRangePicker } from "react-nice-dates";
import "react-nice-dates/build/style.css";

import styled from "styled-components";

const Input = styled.input`
  width: 40px;
`;

const Range = styled.div`
  margin: 0px 20px;
  padding: 10px;
`;

function DateRangePickerExample(props) {
  return (
    <DateRangePicker
      startDate={props.startDate}
      endDate={props.endDate}
      onStartDateChange={props.setStartDate}
      onEndDateChange={props.setEndDate}
      minimumDate={new Date()}
      minimumLength={1}
      format="dd MMM yyyy"
      locale={enGB}
    >
      {({ startDateInputProps, endDateInputProps, focus }) => (
        <Range>
          <Input {...startDateInputProps} placeholder="Check in" />
          <span className="date-range_arrow" />
          <Input {...endDateInputProps} placeholder="Check out" />
        </Range>
      )}
    </DateRangePicker>
  );
}

export default DateRangePickerExample;
